var res = {};
var items = [];
var html = getResCode();
var commentArray = [];

function getComment(nodeHtml) {
    let replyContent = '';
    try {
        let authorHtml = pdfh(nodeHtml, ".tipad&&Text").replace("TOP", "").replace("引用 | 點評", "");
        let authorName = pdfh(nodeHtml, "tr.do_not_catch&&b&&Text");
        let author = '<br><small>' + authorName + authorHtml + '</small>';
        let mContent = pdfh(nodeHtml, "div.tpc_content&&Html");
        replyContent = mContent + author;
    } catch (e) {}
    return replyContent;
};
var reExg = /&npsp;|&nbsp;|<div(?:(?!<\/div>).|\n)*?<\/div>/gi;
var reStr = /ess-data/g;
var reStr2 = /iyl-data=\"([^\"]*?)\"/g;
var content = pdfh(html, "div.tpc_content&&Html").replace(reExg, '').replace(reStr, 'src').replace(reStr2, '');
let pageTitle = pdfh(html, ".f16&&Text");
let author = pdfh(html, 'th&&Text');
items.push({
    title: '<strong>' + pageTitle + '</strong><br/>' + '作者：' + author,
    col_type: 'rich_text'
});
items.push({
    col_type: 'line'
});
items.push({
    title: content,
    col_type: 'rich_text'
});
//log(content)
items.push({
    col_type: 'line'
});
items.push({
    title: '<big><strong>网友评论</strong></big>',
    col_type: 'rich_text'
});
items.push({
    col_type: 'line'
});
commentArray = pdfa(html, '#main&&div.t2');
for (let i = 0; i < commentArray.length; i++) {
    if (i > 0) {
        let item = commentArray[i];
        let comment = getComment(item);
        if (comment !== '') {
            items.push({
                title: comment,
                col_type: 'rich_text'
            });
            items.push({
                col_type: 'line'
            });
        }
    }
}
res.data = items;
setHomeResult(res);

